import Card from "./Card"
import {FaGamepad} from 'react-icons/fa';
import {FaSnapchatGhost} from 'react-icons/fa';

const Projects = () => {
    return (
        <section id="projects">
            <Card icon = {<FaGamepad className="game"/>}/>
            <Card icon = {<FaSnapchatGhost className="ghost"/>}/>
        </section>
    )
}

export default Projects
